import React from 'react';
import Popup from 'reactjs-popup';

const PopupExample = () => (
  <Popup trigger={<button style={{marginTop: "20px"}} className={classes.btn} onClick={<PopupExample/>}>PRICE LIMIT</button>} position="right center">
    <div>Popup content here !!</div>
  </Popup>
);

export default PopupExample;
